import './About.css';
import {Button } from "react-bootstrap";


function About() {
  return (
      
    <div class="main" id="about">
        <div class="main-container">
            <div class="main-imgContainer">
                <div class="main-imgCard"><i class="far fa-snowflake"></i>
                </div>
            </div>
            <div class="main-content">
                <h1>What do we do?</h1>
                <h2>We serve the residents of Edison</h2>
                <p>Fleets of ambulances, along with rescue and special equipment</p>
                <button class = "mainButton"><a href="#">About Us</a></button>
                <Button variant="btn btn-success" onClick={() => window.open("https://www.google.com")}>About us</Button>
            </div>
        </div>
    </div>
  );
}

export default About;
